export default function App(){

    function handlclick(){
        <div  >  <img src="img/air.png" width="300px"/></div>
    }
    return(
        <div className="containner">
            <img src="img/air.png" width="300px"/>
            <button onMouseOver = {handlclick} > click me </button>

        </div>
    )
}
